title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o125.m12 -> o125.m19 -> o153.m0 -> o125.m12
  o125.m19 -> o153.m0 -> o125.m12 -> o125.m19
  o153.m0 -> o125.m12 -> o125.m19 -> o153.m0
  o103.m29 -> o121.m0 -> o103.m25 -> o121.m30 -> o103.m25
  o121.m26 -> o103.m25 -> o121.m30 -> o103.m25
  o121.m14 -> o103.m25 -> o121.m30 -> o103.m25
  o121.m23 -> o103.m25 -> o121.m30 -> o103.m25
  o121.m16 -> o103.m25 -> o121.m30 -> o103.m25
  o121.m31 -> o103.m25 -> o121.m30 -> o103.m25
  o121.m8 -> o103.m25 -> o121.m30 -> o103.m25
